function App() {
  return (
<>
    <Navbar />
      <h1>HOLA</h1>
      <main>
        <Switch>
          <Route path="/inicio-sesion" render={props => <Login storeUser={this.setTheUser} {...props} />} />

        </Switch>
      </main>

</>
  );
}

export default App;
